try:
    import marshal, base64, binascii, hashlib,os,sys,random
    from Crypto.Cipher import AES
    from Crypto.Util.Padding import unpad
except ModuleNotFoundError as e:
    os.system("clear")
    print (f"! Anda Yang Baru Belum di install  :[1;92 {e} [1;97m")
    print (f"Install Modulenya Ulang Ketik :[1;92m pip install pycryptodome")
    time.sleep(2);sys.exit()

def xor_bytes(data, key=0x35):
    return bytes([b ^ key for b in data])

def multi_decrypt(encoded):
    hexed = base64.b64decode(encoded)
    raw = binascii.unhexlify(hexed)
    return xor_bytes(raw)

key_str = marshal.loads(multi_decrypt(k_enc))
key = hashlib.md5(key_str.encode()).digest()

# Dekripsi data AES
raw = base64.b64decode(data)
iv, enc = raw[:16], raw[16:]
cipher = AES.new(key, AES.MODE_CBC, iv)

try:
    plain = unpad(cipher.decrypt(enc), AES.block_size)
    exec(marshal.loads(plain))
except:
    print("Gagal mendekripsi. Mungkin key salah atau data rusak.")
